import React from "react";
import "./TickerItem.scss";

const texts = [
  {
    text: "ANIMALS ONLY!"
  },
  {
    text: "SERIOUSLY!"
  }
];

function TickerItem(props) {
  return <div className={props.text}>ANIMALS ONLY!</div>;
}

export default TickerItem;
